import { useEffect, useState } from "react";
import AppointmentList from "../components/AppointmentList";
import AppointmentDetails from "../pages/AppointmentDetails"

function Home() {
  function handleCreateAppointmentButton() {}
  const [showDetails] = useState(false);


  function handleAppointmentDetails(appointment) {
    console.log(appointment);
    <AppointmentDetails key={appointment.id} appointment={appointment} />
  }

  return (
    <div>
      <p>This is the Home Page</p>

      <div onAppointmentDetails={handleAppointmentDetails}>
        {(!showDetails) ? <AppointmentList /> : <AppointmentDetails />}
      </div>


      <div class="container">
        <div class="center">
          <button
            type="button"
            className="button-primary"
            onClick={handleCreateAppointmentButton}
          >
            Create an Appointment
          </button>
        </div>
      </div>
    </div>
  );
}

export default Home;
